<script>
import moment from 'moment';
import SimpleCrypto from 'simple-crypto-js';
import PixPayment from "./PixPayment.vue";
import Timer from "../timer/timer.vue";
import Badge from '@/components/Badge';
import Button from '@/components/Button';
import Icon from '@/components/Icon';
import Alert from '@/components/Alert';
export default {
    components: {
        Timer,
        Badge,
        Button,
        Icon,
        Alert,
        PixPayment
    },
    data() {
        return {
            qrCodeBase64: "",
            qrCode: '',
            pixGenerated: false,
            payment: [],
            price: '',
            paymentId: '',
            pixKey: '',
            pixTypeKey: '',
            pixName: '',
            customizationPixelMeta: '',
            customizationTagGoogle: '',
            phoneNumber: '',
            collaborator: {},
            user: {},
            campaign: {},
            payment_bd: {}
        }
    },
    created() {
        // Recupere os parâmetros da rota para obter o nome e o ID da campanha
        this.collaboratorId = this.$route.params.id;

        this.getCollaboratorByUuid()
    },
    mounted() {
        /*window.Echo.channel('payment-status.' + this.paymentId).listen('.App\\Events\\PaymentStatusUpdated', (data) => {
            console.log('Payment status updated:', data);
            // Faça o que for necessário com os dados recebidos
        });*/
    },
    methods: {
        expired(value) {
            if (value) {
                if (this.collaborator.uuid) {
                    if (this.payment_bd.status == 'pending') {
                        window.location.href = `${window.location.origin}/voucher/${this.collaborator.uuid}`
                    }
                } else {
                    if (this.payment_bd.status == 'pending') {
                        window.location.href = `${window.location.origin}/app/home`;
                    }
                }
            }
        },
        truncateText(text, maxLength) {
            if (text.length > maxLength) {
                return text.slice(0, maxLength) + "...";
            } else {
                return text;
            }
        },
        extractNumberFromString(str) {
            // Remover os caracteres não numéricos da string
            var numberStr = str.replace(/[^\d.,]/g, '');

            // Substituir a vírgula por ponto decimal
            numberStr = numberStr.replace(',', '.');

            // Converter a string para float
            var number = parseFloat(numberStr);

            return number;
        },
        clearPhone(telefone) {
            // Use uma expressão regular para remover todos os caracteres não numéricos, exceto o '+'
            return telefone.replace(/[^\d+]/g, '');
        },
        openWhatsApp() {
            let phoneclear = this.clearPhone(this.collaborator.campaign.support_number);

            if (!phoneclear.includes('+55') && !phoneclear.includes('+')) {
                phoneclear = '+55' + phoneclear.replace(/^55/, "XX")
            }
            
            const url = `https://wa.me/${phoneclear}?text=Olá, estou com um problema no meu comprovante [${this.collaborator.uuid}].`; // URL do WhatsApp com o número de telefone
            window.open(url, '_blank'); // Abrir em uma nova aba
        },
        redirectCampaign() {
            window.open(window.location.origin + '/acao/' + this.collaborator.campaign.slug)
        },
        goDashboard() {
            window.location.href = window.location.origin + '/app/home';
        },
        redirectDashboard() {
            if (!this.$route.query.preference_id) {
                window.location.href = window.location.origin + '/app/home';
            } else {
                this.getPreferenceMercadoPagoById(this.$route.query.preference_id)
            }
        },
        redirectViewCampaign() {
            window.open(window.location.origin + '/acao/' + this.campaign.slug)
        },
        redirectPayment() {
            window.open(window.location.origin + '/payment/' + this.collaborator.payments[this.collaborator.payments.length - 1].transaction_id)
        },
        getCollaboratorByUuid() {

            const url_payment = `${process.env.VUE_APP_API_BASE_URL}/collaborator/uuid/${this.collaboratorId}`;

            // Fazer uma requisição POST para o endpoint do Laravel
            fetch(url_payment, {
                method: 'GET',
                headers: {
                    'Content-Type': 'application/json'
                },
                verify: false
            })
                .then(response => response.json())
                .then(res => {
                    ///COLAB
                    if (res[0]) {
                        this.collaborator = res[0]
                        this.campaign = res[0].campaign
                        this.payment_bd = res[0].payments[res[0].payments.length - 1];

                        this.user = res[0].campaign.user;
                        if (res[0].id) {
                            moment.locale('pt-br');
                            this.collaborator.created_at = moment(this.collaborator.created_at).format('dddd, D [de] MMMM [de] YYYY [às] HH:mm:ss');
                            this.phoneNumber = res[0].campaign.support_number;
                            if (res[0].campaign.user.customizations) {
                                this.customizationImage = res[0].campaign.user.customizations[0].image;
                                this.customizationPixelMeta = res[0].campaign.user.customizations[0].pixel_meta;
                                this.customizationTagGoogle = res[0].campaign.user.customizations[0].tag_gooogle;

                                fbq('init', this.customizationPixelMeta);
                                fbq('track', 'Purchase', {
                                        content_type: 'product', value: this.payment_bd.amount, currency: "BRL", num_items: this.collaborator.amount_of_tickets
                                    });
                            }
                        }
                        //CAMPAIGN
                    } else {
                        const url_payment = `${process.env.VUE_APP_API_BASE_URL}/campaign/uuid/${this.collaboratorId}`;

                        // Fazer uma requisição POST para o endpoint do Laravel
                        fetch(url_payment, {
                            method: 'GET',
                            headers: {
                                'Content-Type': 'application/json'
                            },
                            verify: false
                        })
                            .then(response => response.json())
                            .then(res => {
                                if (res[0]) {

                                    fbq('track', 'Purchase', {
                                        content_type: 'service', value: this.extractNumberFromString(res[0].fee.fee), currency: "BRL", num_items: 1
                                    });

                                    dataLayer.push({
                                        'event': 'purchase-123rifas',
                                        'conversionValue': this.extractNumberFromString(res[0].fee.fee),
                                        'ecommerce': {
                                            'purchase': {
                                                'actionField': {
                                                    'id': res[0].id,
                                                    'affiliation': '123RIFAS',
                                                    'revenue': this.extractNumberFromString(res[0].fee.fee),
                                                    'email': res[0].user.email, // Inclua o e-mail do comprador
                                                    'phone': res[0].user.phone // Inclua o telefone do comprador
                                                },
                                                'products': [
                                                    {
                                                        'id': res[0].uuid,
                                                        'name': res[0].name,
                                                        'price': this.extractNumberFromString(res[0].fee.fee),
                                                        'category': 'Serviço',
                                                    }
                                                    // Adicione mais produtos, se houver
                                                ]
                                            }
                                        }
                                    });

                                    this.campaign = res[0]
                                    this.user = res[0].user
                                    this.payment_bd = res[0].payments[res[0].payments.length - 1];
                                    moment.locale('pt-br');
                                    this.campaign.created_at = moment(this.campaign.created_at).format('dddd, D [de] MMMM [de] YYYY [às] HH:mm:ss');
                                    this.phoneNumber = process.env.VUE_APP_SUPPORT_NUMBER
                                }
                            })
                            .catch(error => {
                                console.error(error);
                            });
                    }
                })
                .catch(error => {
                    console.error(error);
                });
        },
    }
};
</script>
